import React, { useState, useEffect } from 'react';
import {
  AppBar,
  Box,
  Drawer,
  IconButton,
  Toolbar,
  Typography,
  TextField,
  Button,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
} from '@mui/material';
import { DataGrid } from '@mui/x-data-grid';
import MenuIcon from '@mui/icons-material/Menu';
import axios from 'axios';

const drawerWidth = 240;

function Dashboard() {
  const [models, setModels] = useState([]);
  const [open, setOpen] = useState(false);
  const [searchTerm, setSearchTerm] = useState('');
  const [newModel, setNewModel] = useState({
    name: '',
    gladia: '',
    fastwhisper: '',
    yandexSpeechKit: '',
  });

  const columns = [
    { field: 'id', headerName: 'ID', width: 70 },
    { field: 'name', headerName: 'Name', width: 200 },
    { field: 'gladia', headerName: 'Gladia', width: 200 },
    { field: 'fastwhisper', headerName: 'FastWhisper', width: 200 },
    { field: 'yandexSpeechKit', headerName: 'Yandex Speech Kit', width: 200 },
  ];

  useEffect(() => {
    fetchModels();
  }, []);

  const fetchModels = async () => {
    try {
      const response = await axios.get('http://localhost:8085/api/models');
      setModels(response.data);
    } catch (error) {
      console.error('Error fetching models:', error);
    }
  };

  const handleCreateModel = async () => {
    try {
      await axios.post('http://localhost:8085/api/models', newModel);
      setOpen(false);
      fetchModels();
      setNewModel({
        name: '',
        gladia: '',
        fastwhisper: '',
        yandexSpeechKit: '',
      });
    } catch (error) {
      console.error('Error creating model:', error);
    }
  };

  const filteredModels = models.filter(model =>
    model.name.toLowerCase().includes(searchTerm.toLowerCase())
  );

  return (
    <Box sx={{ display: 'flex' }}>
      <AppBar position="fixed" sx={{ zIndex: (theme) => theme.zIndex.drawer + 1 }}>
        <Toolbar>
          <IconButton
            color="inherit"
            aria-label="open drawer"
            edge="start"
            sx={{ mr: 2 }}
          >
            <MenuIcon />
          </IconButton>
          <Typography variant="h6" noWrap component="div">
            Speech Models Dashboard
          </Typography>
        </Toolbar>
      </AppBar>
      <Drawer
        variant="permanent"
        sx={{
          width: drawerWidth,
          flexShrink: 0,
          '& .MuiDrawer-paper': {
            width: drawerWidth,
            boxSizing: 'border-box',
          },
        }}
      >
        <Toolbar />
        <Box sx={{ overflow: 'auto', p: 2 }}>
          <TextField
            fullWidth
            label="Search by name"
            variant="outlined"
            value={searchTerm}
            onChange={(e) => setSearchTerm(e.target.value)}
            sx={{ mb: 2 }}
          />
          <Button
            variant="contained"
            fullWidth
            onClick={() => setOpen(true)}
          >
            Add New Model
          </Button>
        </Box>
      </Drawer>
      <Box component="main" sx={{ flexGrow: 1, p: 3 }}>
        <Toolbar />
        <div style={{ height: 600, width: '100%' }}>
          <DataGrid
            rows={filteredModels}
            columns={columns}
            pageSize={10}
            rowsPerPageOptions={[10]}
            checkboxSelection
            disableSelectionOnClick
          />
        </div>
      </Box>

      <Dialog open={open} onClose={() => setOpen(false)}>
        <DialogTitle>Add New Model</DialogTitle>
        <DialogContent>
          <TextField
            autoFocus
            margin="dense"
            label="Name"
            fullWidth
            value={newModel.name}
            onChange={(e) => setNewModel({ ...newModel, name: e.target.value })}
          />
          <TextField
            margin="dense"
            label="Gladia"
            fullWidth
            value={newModel.gladia}
            onChange={(e) => setNewModel({ ...newModel, gladia: e.target.value })}
          />
          <TextField
            margin="dense"
            label="FastWhisper"
            fullWidth
            value={newModel.fastwhisper}
            onChange={(e) => setNewModel({ ...newModel, fastwhisper: e.target.value })}
          />
          <TextField
            margin="dense"
            label="Yandex Speech Kit"
            fullWidth
            value={newModel.yandexSpeechKit}
            onChange={(e) => setNewModel({ ...newModel, yandexSpeechKit: e.target.value })}
          />
        </DialogContent>
        <DialogActions>
          <Button onClick={() => setOpen(false)}>Cancel</Button>
          <Button onClick={handleCreateModel}>Create</Button>
        </DialogActions>
      </Dialog>
    </Box>
  );
}

export default Dashboard;
